import React from 'react';
import MenuList from './MenuItems';


const MenuCards = () => {
    return (
        <>
            {
                MenuList.map((val, ind) => {
                    <div className='col-md-4'>
                        <div className="card">
                            <img className="card-img-top" src={MenuList.img} alt="Card image" />
                            <div className="card-body">
                                <h4 className="card-title">{MenuList.item}</h4>
                                <p className="card-text">{MenuList.description}</p>
                                <h5 className="card-cat">{MenuList.category}</h5>
                                <a href="#" className="btn btn-primary">Read More</a>
                            </div>
                        </div>
                    </div>
                })
            }

        </>
    )
}

export default MenuCards
